import React, { useEffect, useState } from 'react'
import './index.css';

function Dado(props) {

    const [ dado, setDado ] = useState(0);

    useEffect(() => {
        alert(JSON.stringify(props));
        setDado(props.dado);
    }, [] )

    return (<>
        <div className="card dado mt-5 w-25">
            <div className="card-body center">
                <span>{dado}</span>
            </div>
        </div>
    </>)
}

export default Dado;
